import React from "react";
import styles from './CalendarPresent.module.css';

function CalendarPresent() {

return <div>
    <div class={styles.buttons}>
        <button>Назад</button>
        <button>Вперед</button>
    </div>
</div>
}

export default CalendarPresent;
